<div class="box-body">
    <p style="text-align:justify;text-indent:40px;">Fitur Sinkronisasi CSI Manual dapat diakses oleh user Administrator dan Operator yang dimana memiliki fungsi untuk Melakukan Sinkronisasi secara langsung diwaktu yang sama, artinya pada saat ada perubahan dan penambahan data CSI pada TMS Veristore maka sinkronisasi bisa dilakukan secara langsung di Verification Tools.</p>
    <ol style="text-align:justify;">
        <li>Pada halaman home page silahkan pilih “Sinkronisasi CSI kemudian pilih Manual”.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Pada saat fitur Sinkronisasi CSI sudah dipilih kemudian pengguna pilih Manual maka akan tampil semua Sinkronisasi Data CSI.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Pada halaman Sinkronisasi Data CSI ini pengguna bisa langsung melakukan Sinkronisasi Data CSI dengan menekan tombol “Sekarang”.<br>Note : Sinkronasi secara langsung ini dapat dilakukan jika pengguna sudah melakukan perubahan dan penambahan CSI pada TMS Veristore.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Setelah tombol Sekarang ditekan maka proses “Sinkronisasi data sedang berlangsung”.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Untuk memastikan proses sinkronisasi data selesai maka pengguna harus melakukan memuat ulang halaman berulang sampai sinkronisasi selesai, jika proses Sinkronisasi Data CSI selesai maka notifikasi “Sinkronisasi data sedang berlangsung” akan hilang, dan data sinkronisasi akan bertambah.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
    </ol>
</div>
